const state = {
  currentSlide: 0
}

const mutations = {
  'CHANGE_START_SLIDE' (state, id) {
    state.currentSlide = id
  }
}

const actions = {
  changeStartSlide: ({ commit }, id) => {
    commit('CHANGE_START_SLIDE', id)
  }
}

const getters = {
  currentSlide: state => {
    return state.currentSlide
  }
}

export default {
  state,
  mutations,
  actions,
  getters
}
